;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">1）计费重≥30KG必须打木托/木架/木箱。当单件计费重≤30kg，但单边≥1.2米，或围长超≥3米，若不打木架/木箱，单价+5元/kg。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">2）托盘80元/平方，最低80元/托；参考标准：打托后计费重预计+15~30KG/件，具体以实际测量为准</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">3）木架200元/立方，最低200元/个；打木箱280元/立方，最低280元/个。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">4）打托底脚：15元/个。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">5）其他操作费根据操作难度另议。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">6）为避免争议，一票多件的异形件货物，客户需自行打好木托\木架\木箱后再入仓，如委托我司打包装，打包后的尺寸以实际测量为准。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">7）宽度太窄（≤25cm）并且要求只能竖放的木箱/木架，需要加宽加固防止倒塌和损坏（立放的宽度建议宽于50cm）</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">8）木箱宽度超过50cm，平面面积过大的木箱内部需要加横梁和立柱，加固费用100元/件起</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">9）建议客户用中纤板，夹板，三合板或者胶合板等非实木材料。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><o:p></o:p></span></b></p></td></tr><tr style="height:206.0000pt;"><td width="1409" valign="center" colspan="9" style="width:1056.8500pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:none;
