 rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">2）改单费：装柜后~到港前：改单费300元/票；到港后~入海外仓前：改单费500元/票；入海外仓后~出仓派送前：改单费800元/票；出仓派送后需要改单改派的，将根据具体情况另议收费。所有到港后改地址的订单，不保证改派成功。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><font face="微软雅黑">（</font><font face="微软雅黑">3）二次派送费：收取单票总费用的30%起。</font></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><br></span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;">9、滞纳金：我司实行款到装货原则，开船/发车超过7天未付款的，将收取200元起/票滞纳金。</span></b><b><span style="font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: 10pt;"><o:p></o:p></span></b></p></td></tr><tr style="height:131.0000pt;"><td width="218" valign="center" style="width:163.5000pt;padding:0.0000pt 5.4000pt 0.0000pt 5.4000pt ;border-left:1.0000pt solid rgb(0,0,0);
